import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

export default function PetTable({props}) {
    return (
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} size="small" aria-label="a table of pets">
          <TableHead>
            <TableRow>
              <TableCell>Pet Name</TableCell>
              <TableCell align="right">Age</TableCell>
              <TableCell align="right">Species</TableCell>
              <TableCell align="left">Remove Pet</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {/** use a map function of props passed in (how to link button?)*/}
            <TableRow>
                <TableCell component="th" scope="row">props.Test</TableCell>
                <TableCell align="right">props.Age</TableCell>
                <TableCell align="right">props.Species</TableCell>
                <TableCell><Button color="error" variant="contained" size="small" align="right">Remove</Button></TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
